class Hello{

	def log
	def context
	def testRunner

	Hello(log, context, testRunner){
		this.log = log
		this.context = context
		this.testRunner = testRunner

		}

	def sayHello(String name){
		log.info("Hello "+ name + ".....")
		}

	}

	context.setProperty("Hello", new Hello(log, context, testRunner))

def project = testRunner.testCase.testSuite.project
def tcase = project.testSuites["TestSuite3"].testCases["TestCase1"];
def hello = tcase.getTestStepByName("Hello")

hello.run(testRunner, context)

context.Hello.sayHello("Ragahav")

